        <h2>Je to vaš prvi obisk?</h2>
        <div class="subcontent">
            <p><b>Predavatelji in asistenti FMF:</b> prijavite se z elektronskim naslovom, praviloma <em>Ime.Priimek@fmf.uni-lj.si</em>, in z geslom na FMF.</p><p><b>Študenti FMF:</b> prijavite se z elektronskim naslovom, praviloma <em>Ime.Priimek@student.fmf.uni-lj.si ali pa <em>Ime.PriimekN@student.fmf.uni-lj.si</em></em>, in z geslom na FMF.</p><p><b>Študenti brez statusa in zunanji študenti:</b> uporabniški račun si ustvarite sami. Uporabniško ime naj bo oblike imepriimek, da bomo lahko uporabniška imena povezali s pravimi ljudmi na predavanjih in vajah. Ostala uporabniška imena znamo brez opozorila pobrisati.</p><p>Študenti FMF, ki imajo študentsko uporabniško ime, morajo uporabljati le tega in se ne smejo samoregistrirati z novim uporabniškim imenom. Kazen bo vzgojna.</p>
